INSERT INTO `peliculas` (`id`, `titulooriginal`, `titulocastellano`, `anno`, `duracion`, `director`, `reparto`, `sinopsis`, `portada`, `generos`) VALUES
(3, 'Shrek', 'Shrek', 2001, '90', 'Andrew Adamson, Vicky Jenson', 'Mike Myers,Eddie Murphy,Cameron Diaz', 'Hace mucho, mucho tiempo, en una lejanísima ciénaga vivía un intratable ogro llamado Shrek. Pero de repente, un día, su absoluta soledad se ve interrumpida por una invasión de sorprendentes personajes de cuento. Hay ratoncitos ciegos en su comida, un enorme y malísimo lobo en su cama, tres cerditos sin hogar y otros muchos seres increíbles que han sido deportados de su reino por el malvado Lord Farquaad. Para conseguir salvar su terreno, y de paso a sí mismo, Shrek hace un pacto con Farquaad y emprende viaje para conseguir que la preciosa princesa Fiona sea la novia del Lord. En tan importante misión le acompañan un burro chistoso, dispuesto a hacer cualquier cosa por Shrek. Todo, menos estarse calladito. Rescatar a la princesa de una dragona enamoradiza que suelta fuego al respirar va a resultar una tontería comparado con lo que ocurre cuando el oscuro secreto que la joven guardaba es revelado.', 'https://m.media-amazon.com/images/M/MV5BOGZhM2FhNTItODAzNi00YjA0LWEyN2UtNjJlYWQzYzU1MDg5L2ltYWdlL2ltYWdlXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 'Animación,Aventura,Comedia'),
(5, 'Kung Fu Panda', 'Kung Fu Panda', 2008, '92', 'Mark Osborne, John Stevenson', 'Jack Black,Ian McShane,Angelina Jolie', 'El protagonista es un oso panda llamado Po, el más vago de todas las criaturas del Valle de la Paz. Con poderosos enemigos acercándose, la esperanza es depositada en una antigua profecía que dice que un héroe se alzará para salvarles. Voces originales de Jack Black, Angelina Jolie, Dustin Hoffman, Lucy Liu & Jackie Chan.', 'https://m.media-amazon.com/images/M/MV5BODJkZTZhMWItMDI3Yy00ZWZlLTk4NjQtOTI1ZjU5NjBjZTVjXkEyXkFqcGdeQXVyODE5NzE3OTE@._V1_SX300.jpg', 'Animación,Acción,Aventura'),
(6, 'Kung Fu Panda 2', 'Kung Fu Panda 2', 2011, '90', 'Jennifer Yuh Nelson', 'Jack Black,Angelina Jolie,Jackie Chan', 'Po está ahora viviendo su sueño como el Guerrero del Dragón, protegiendo el Valle de la Paz junto a sus amigos y sus compañeros maestros del kung fu. Los Cinco Furiosos. Pero su nueva e impresionante vida se encuentra amenazada por la aparición de un villano formidable, que planea usar un arma secreta imparable para conquistar China y destruir el kung fu. Po debe volver la vista a su pasado para descubrir los secretos de su misterioso origen; solo entonces podrá adquirir la fuerza que necesita para vencer.', 'https://m.media-amazon.com/images/M/MV5BYzQ0ZWIxZjAtYWI3Yy00MGM0LWFjOGYtNzcyYThiOTA3ODI1XkEyXkFqcGdeQXVyODE5NzE3OTE@._V1_SX300.jpg', 'Animación,Acción,Aventura'),
(7, 'Kung Fu Panda 3', 'Kung Fu Panda 3', 2016, '95', 'Alessandro Carloni, Jennifer Yuh Nelson', 'Jack Black,Bryan Cranston,Dustin Hoffman', 'Cuando el durante mucho tiempo perdido padre de Po aparece de repente, el dúo ya reunido viaja a un paraíso secreto de pandas para conocer a montones de nuevos e hilarantes osos. Pero cuando el villano sobrenatural Kai comienza a recorrer toda China venciendo a todos los maestros de kung fu, Po deberá hacer lo imposible: aprender a entrenar a una comunidad repleta de divertidos y torpes hermanos para formar el equipo definitivo de Kung Fu Pandas.', 'https://m.media-amazon.com/images/M/MV5BMTUyNzgxNjg2M15BMl5BanBnXkFtZTgwMTY1NDI1NjE@._V1_SX300.jpg', 'Animación,Acción,Aventura'),
(9, 'How to Train Your Dragon 2', 'Cómo entrenar a tu dragón', 2010, '98', 'Dean DeBlois, Chris Sanders', 'Jay Baruchel,Gerard Butler,Christopher Mintz-Plasse', 'Ambientada en el mítico mundo de los rudos vikingos y los dragones salvajes, y basada en el libro infantil de Cressida Cowell, esta comedia de acción narra la historia de Hipo, un vikingo adolescente que no encaja exactamente en la antiquísima reputación de su tribu como cazadores de dragones. El mundo de Hipo se trastoca al encontrar a un dragón que le desafía a él y a sus compañeros vikingos, a ver el mundo desde un punto de vista totalmente diferente.', 'https://m.media-amazon.com/images/M/MV5BMjA5NDQyMjc2NF5BMl5BanBnXkFtZTcwMjg5ODcyMw@@._V1_SX300.jpg', 'Animación,Acción,Aventura'),
(10, 'How to Train Your Dragon: The Hidden World', 'Cómo entrenar a tu dragón 3', 2019, '104', 'Dean DeBlois', 'Jay Baruchel,America Ferrera,F. Murray Abraham', 'Lo que comenzó como la inesperada amistad entre un joven vikingo y un temible dragón, Furia Nocturna,  se ha convertido en una épica trilogía que ha recorrido sus vidas. En esta nueva entrega, Hipo y Desdentao descubrirán finalmente su verdadero destino: para uno, gobernar Isla Mema junto a Astrid; para el otro, ser el líder de su especie. Pero, por el camino, deberán poner a prueba los lazos que los unen, plantando cara a la mayor amenaza que jamás haya afrontado... y a la aparición de una Furia Nocturna hembra.', 'https://m.media-amazon.com/images/M/MV5BMjIwMDIwNjAyOF5BMl5BanBnXkFtZTgwNDE1MDc2NTM@._V1_SX300.jpg', 'Animación,Acción,Aventura'),
(11, 'Django', 'Django', 1966, '91', 'Sergio Corbucci', 'Franco Nero,José Canalejas,José Bódalo', 'Lucy (Chika Ike) and her boyfriend decide to change their location in order to make a better living, while they were away they came in contact with a very notorious criminal and heartless assassin Django (Hank Anuku) who take them in and made them his partner in the the same business.', 'https://m.media-amazon.com/images/M/MV5BZTU3MTU5OGEtZDllMS00ZTBjLTk3ZGItZWUzMDMyM2Y4YTgzXkEyXkFqcGdeQXVyMTA0MTM5NjI2._V1_SX300.jpg', 'Acción,Drama,Western'),
(12, 'Django Unchained', 'Django desencadenado', 2012, '165', 'Quentin Tarantino', 'Jamie Foxx,Christoph Waltz,Leonardo DiCaprio', 'Dos años antes de estallar la Guerra Civil (1861-1865), Schultz, un cazarrecompensas alemán que le sigue la pista a unos asesinos, le promete al esclavo Django dejarlo en libertad si le ayuda a atraparlos. Terminado con éxito el trabajo, Django prefiere seguir al lado del alemán y ayudarle a capturar a los delincuentes más buscados del Sur. Se convierte así en un experto cazador de recompensas, pero su único objetivo es rescatar a su esposa Broomhilda, a la que perdió por culpa del tráfico de esclavos. La búsqueda llevará a Django y a Schultz hasta Calvin Candie, el malvado propietario de la plantación \"Candyland\". La presencia de ambos en los alrededores de la propiedad, despierta las sospechas de Stephen, el esclavo de confianza de Candie.', 'https://m.media-amazon.com/images/M/MV5BMjIyNTQ5NjQ1OV5BMl5BanBnXkFtZTcwODg1MDU4OA@@._V1_SX300.jpg', 'Drama,Western'),
(13, 'Saw', 'Saw (Corto original)', 2004, '103', 'James Wan', 'Cary Elwes,Leigh Whannell,Danny Glover', 'David, un médico del hospital de la ciudad, cuenta a la policía su terrible historia: fue capturado por un psicópata que le obligó a jugar a un macabro juego de supervivencia. Cortometraje que derivó en la famosa película de 2004 \"Saw\", con idéntico reparto y equipo técnico y que sirvió de inicio a una de las sagas de terror más rentables de la historia del cine. (FILMAFFINITY)', 'https://m.media-amazon.com/images/M/MV5BM2M1MzI1MWYtYmM2ZC00OWY3LTk0ZGMtNmRkNzU1NzEzMWE5XkEyXkFqcGdeQXVyODUwOTkwODk@._V1_SX300.jpg', 'Terror,Misterio,Suspense'),
(14, 'Kingsman: The Secret Service', 'Kingsman: Servicio secreto', 2014, '129', 'Matthew Vaughn', 'Colin Firth,Taron Egerton,Samuel L. Jackson', 'Un veterano agente secreto inglés (Colin Firth) debe entrenar a un joven sin refinar (Taron Egerton), pero que promete convertirse en un competitivo agente gracias a un ultra-programa de entrenamiento, al mismo tiempo que una amenaza global emerge procedente de un genio retorcido. Adaptación del cómic de Mark Millar y Dave Gibbons.', 'https://m.media-amazon.com/images/M/MV5BYTM3ZTllNzItNTNmOS00NzJiLTg1MWMtMjMxNDc0NmJhODU5XkEyXkFqcGdeQXVyODE5NzE3OTE@._V1_SX300.jpg', 'Acción,Aventura,Comedia'),
(16, 'Kingsman: The Golden Circle', 'Kingsman: El círculo de oro', 2017, '141', 'Matthew Vaughn', 'Taron Egerton,Colin Firth,Mark Strong', 'Cuando se produce un ataque contra el cuartel general de Kingsman y un nuevo villano se levanta, Eggsy y Merlin se ven obligados a trabajar junto con la agencia americana conocida como el Statesman para salvar al mundo.', 'https://m.media-amazon.com/images/M/MV5BMjQ3OTgzMzY4NF5BMl5BanBnXkFtZTgwOTc4OTQyMzI@._V1_SX300.jpg', 'Acción,Aventura,Comedia'),
(17, 'Monty Python and the Holy Grail', 'Los caballeros de la mesa cuadrada y sus locos seguidores', 1975, '91', 'Terry Gilliam, Terry Jones', 'Graham Chapman,John Cleese,Eric Idle', 'El rey Arturo y sus caballeros reciben un encargo divino: partir en búsqueda del Santo Grial, para lo cual deberán luchar contra enemigos muy diversos: malignos caballeros rivales, bestias sanguinarias (que solo son visibles como dibujo animado), groseros caballeros franceses fortificando un castillo en Inglaterra, brujas, adivinos mefistofélicos, Scotland Yard, y hasta un conejo asesino y carnívoro (que muere destruido por una cómica reliquia traída de las Cruzadas: la \"Santa Granada de Mano de Antioquia\").', 'https://m.media-amazon.com/images/M/MV5BN2IyNTE4YzUtZWU0Mi00MGIwLTgyMmQtMzQ4YzQxYWNlYWE2XkEyXkFqcGdeQXVyNjU0OTQ0OTY@._V1_SX300.jpg', 'Aventura,Comedia,Fantasía'),
(22, 'Interstellar', 'Interstellar', 2014, '169', 'Christopher Nolan', 'Matthew McConaughey,Anne Hathaway,Jessica Chastain', 'Narra las aventuras de un grupo de exploradores que hacen uso de un agujero de gusano recientemente descubierto para superar las limitaciones de los viajes espaciales tripulados y vencer las inmensas distancias que tiene un viaje interestelar.', 'https://m.media-amazon.com/images/M/MV5BZjdkOTU3MDktN2IxOS00OGEyLWFmMjktY2FiMmZkNWIyODZiXkEyXkFqcGdeQXVyMTMxODk2OTU@._V1_SX300.jpg', 'Aventura,Drama,Ciencia ficción'),
(23, 'The Nun', 'The Nun', 2018, '96', 'Corin Hardy', 'Demián Bichir,Taissa Farmiga,Jonas Bloquet', 'Logan and Thomas are two best friends, but when Logan gets arrested, its up to Thomas to break him out of jail', 'https://m.media-amazon.com/images/M/MV5BMjM3NzQ5NDcxOF5BMl5BanBnXkFtZTgwNzM4MTQ5NTM@._V1_SX300.jpg', 'Terror,Misterio,Suspense'),
(24, 'Shrek 2', 'Shrek 2', 2004, '93', 'Andrew Adamson, Kelly Asbury, Conrad Vernon', 'Mike Myers,Eddie Murphy,Cameron Diaz', 'Cuando Shrek y la princesa Fiona regresan de su luna de miel, los padres de ella los invitan a visitar el reino de Muy Muy Lejano para celebrar la boda. Para Shrek, al que nunca abandona su fiel amigo Asno, esto constituye un gran problema. Los padres de Fiona, por su parte, no esperaban que su yerno tuviera un aspecto semejante y, mucho menos, que su hija hubiera cambiado tanto. Todo esto trastoca los planes del rey respecto al futuro del reino. Pero entonces entran en escena la maquiavélica Hada Madrina, su arrogante hijo el Príncipe Encantador y un minino muy especial: el Gato con Botas, experto cazador de ogros.', 'https://m.media-amazon.com/images/M/MV5BMDJhMGRjN2QtNDUxYy00NGM3LThjNGQtMmZiZTRhNjM4YzUxL2ltYWdlL2ltYWdlXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 'Animación,Aventura,Comedia'),
(27, 'Inception', 'Origen', 2010, '148', 'Christopher Nolan', 'Leonardo DiCaprio,Joseph Gordon-Levitt,Elliot Page', 'Dom Cobb es un ladrón hábil, el mejor de todos, especializado en el peligroso arte de extracción: el robo de secretos valiosos desde las profundidades del subconsciente durante el estado de sueño cuando la mente está más vulnerable. Esta habilidad excepcional de Cobb le ha hecho un jugador codiciado en el traicionero nuevo mundo de espionaje corporativo, pero al mismo tiempo, le ha convertido en un fugitivo internacional y ha tenido que sacrificar todo que le importaba. Ahora a Cobb se le ofrece una oportunidad para redimirse. Con un último trabajo podría recuperar su vida anterior, pero solamente si logra lo imposible.', 'https://m.media-amazon.com/images/M/MV5BMjAxMzY3NjcxNF5BMl5BanBnXkFtZTcwNTI5OTM0Mw@@._V1_SX300.jpg', 'Acción,Aventura,Ciencia ficción');

